    return (
        
            <div class="col-md-6 col-lg-4 align-items-center">
            <div class="contact text-center">
              <h5 class="text-light">Contact Us</h5>
              <p class="lh-lg mt-3 mb-5">get in touch with any kind now klshsdvh</p>
              <Link class="btn rounded-pill main-btn " style={{color: "#ffffff;"}} href="#">
                Email us now!
              </Link>
              <ul class="d-flex mt-5 list-unstyled gap-5 justify-content-center">
                <li>
                  <a class="d-block text-light rounded-circle" href="#"> <i class="fa-brands fa-facebook facebook"></i> </a>
                </li>
                <li>
                  <a class="d-block text-light rounded-circle" href="#"> <i class="fa-brands fa-linkedin linkedin"></i> </a>
                </li>
                <li>
                  <a class="d-block text-light rounded-circle" href="#"> <i class="fa-brands fa-twitter twiter"></i> </a>
                </li>

              </ul>
            </div>
          </div>
      
    );
};

export default Footer;
